import React from 'react';
import styled from "styled-components";
import {Button} from "../../styles/common";

const StyledGallery = styled.div`
  background: #F1F8F4;
  padding: 10rem 0;
  display: flex;
  align-items: center;
`

const GalleryItem = styled.div`
  position: relative;
  width: 100%;
`

const GalleryItemImg = styled.img`
  width: 100%;
  height: auto;
`

const GalleryItemBtn = styled(Button)`
  background: #FFFFFF;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  padding: 1.8rem ;
`

function Gallery() {
  return (
    <StyledGallery>
      <GalleryItem>
        <GalleryItemImg src="./img/gallery/image-1.jpg" alt="" />
        <GalleryItemBtn>Organic Juice</GalleryItemBtn>
      </GalleryItem>
    </StyledGallery>
  );
}

export default Gallery;
